<!doctype html>

<html lang="en">

<head>
  <meta charset="utf-8">

  <title>Pickup</title>
  <meta name="description" content="Pickup">
  <meta name="author" content="Jonathan Sprauel">


</head>

<body>
  <p id="Bonus_card"></p>

  <div id="Available_actions" style="  width: 100%; height:300px;margin: 0 auto;"></div>

  <p id="Available_actions_num"></p>

  <div>
    <button onclick="init()">New game</button>
    <button onclick="next()">Next Turn</button>
  </div>

  <script>
    /**
     * Shuffles array in place.
     * @param {Array} a items An array containing the items.
     */
    function shuffle(a) {
      var j, x, i;
      for (i = a.length - 1; i > 0; i--) {
        j = Math.floor(Math.random() * (i + 1));
        x = a[i];
        a[i] = a[j];
        a[j] = x;
      }
      return a;
    }

    var cars = [];
    // redefine the array
    for (i = 0; i < 6; i++) {
      cars.push("Move-blue-card")
      cars.push("Move-red-card")
      cars.push("Move-yellow-card")
    }

    var bonus_cards = [
      "Bonus-orange-card", 
      "Bonus-violet-card", 
      "Bonus-Green-card"];

    var turn_index = 0;
    var step_index = 0;

    function draw() {

      var text = "";
      var i;

      var svgns = "http://www.w3.org/2000/svg";
      var xlinkns = "http://www.w3.org/1999/xlink";
      document.getElementById("Available_actions").innerHTML = '';

      // adding back card
      if (turn_index < cars.length - 4) {
        var use = document.createElementNS(svgns, "use");
        use.setAttributeNS(xlinkns, "href", "#Back-card");
        var svg = document.createElementNS(svgns, "svg");
        svg.setAttribute('width', 180);
        svg.setAttribute('height', 270);
        svg.appendChild(use);
        document.getElementById("Available_actions").appendChild(svg);
      }
      document.getElementById("Available_actions_num").innerHTML = (cars.length - 4 - turn_index) + "/" + (cars.length - 4);

      for (i = turn_index + 3; i >= turn_index; i--) {

        var use = document.createElementNS(svgns, "use");
        use.setAttributeNS(xlinkns, "href", "#" + cars[i]);
        var svg = document.createElementNS(svgns, "svg");
        svg.setAttribute('width', 180);
        svg.setAttribute('height', 270);

        svg.appendChild(use);
        document.getElementById("Available_actions").appendChild(svg);
      }





      // Bonus cards
      document.getElementById("Bonus_card").innerHTML = '';
      var use = document.createElementNS(svgns, "use");
      use.setAttributeNS(xlinkns, "href", "#" + bonus_cards[step_index]);
      var svg = document.createElementNS(svgns, "svg");
      svg.setAttribute('width', 180);
      svg.setAttribute('height', 270);

      svg.appendChild(use);
      document.getElementById("Bonus_card").appendChild(svg);

      

    }

    function init() {
      cars = [];
      // redefine the array
      for (i = 0; i < 6; i++) {
        cars.push("Move-blue-card")
        cars.push("Move-red-card")
        cars.push("Move-yellow-card")
      }

      shuffle(cars)

      // Bonus cards
      shuffle(bonus_cards)
      
      turn_index = 0;
      step_index = 0;
      draw();
    }

    function next() {
      turn_index += 1;

      if ((turn_index + 4) > cars.length) {
        // a new handle
        cars = cars.slice(0, cars.length - 3)
        turn_index = 0;
        step_index += 1;
        shuffle(cars);

      }

      if (step_index >= bonus_cards.length) {
        // end of game
        document.getElementById("Available_actions").innerHTML = "";
        document.getElementById("Bonus_card").innerHTML = "End of game";
      } else {
        draw();
      }
    }
  </script>
</body>
